import { Component, OnInit } from '@angular/core';
import { Router, NavigationEnd } from '@angular/router';
import { filter } from 'rxjs/operators';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  constructor(private router: Router) {}

  ngOnInit(): void {
    this.router.events.pipe(
      filter(event => event instanceof NavigationEnd)
    ).subscribe(() => {
      if (this.router.url === '/inicio-sesion') {
        // Aquí podrías redirigir a una página diferente si es necesario
        // Por ejemplo, redirigir a la ruta principal si la ruta actual es inicio-sesion
        this.router.navigate(['/inicio-sesion']);
      }
    });
  }
}
<!-- Mostrar el header solo si la ruta no es inicio-sesion -->
<app-header *ngIf="router.url !== '/inicio-sesion'"></app-header>

<main>
  <!-- Mostrar la página principal solo si la ruta no es inicio-sesion -->
  <app-pagina-principal *ngIf="router.url !== '/inicio-sesion'"></app-pagina-principal>
  <router-outlet *ngIf="router.url !== '/inicio-sesion'"></router-outlet>
</main>

<!-- Mostrar el footer solo si la ruta no es inicio-sesion -->
<app-footer *ngIf="router.url !== '/inicio-sesion'"></app-footer>
